import React from "react";
import DeleteIcon from '@mui/icons-material/Delete';
import './Style.css'


export default function DeletarProduto({ produto, onDelete }) {
  const executarDelecaoProduto = async () => {
    try {
      await onDelete(produto.id);
      console.log("Produto deletado com sucesso");
    } catch (error) {
      console.error("Erro ao deletar produto", error);
    }
  };

  return (

    <button className='btn-deletar-produto'  onClick={executarDelecaoProduto} startIcon={<DeleteIcon />}>
    <DeleteIcon />
    </button>

  );
}
